class PyroNoiseTests(TestCase):
    """Tests of the abstract PyroNoise OTU Picker class"""
    def setUp(self):
        self.file_content = file_content
        self.header = get_header_info(header.split('\n'))
        self.small_flowgram_collection = FlowgramCollection(flowgrams, header_info=self.header)
        self.large_flowgram_collection = FlowgramCollection(large_example, header_info=self.header)
        
        self.sff_path = get_tmp_filename(
            prefix='pyroNoiseTest_', suffix='.sff.txt')
        self.large_flowgram_collection.writeToFile(self.sff_path)
        
    def tearDown(self):
        remove(self.sff_path)
      
    def test_writePyronoisefile(self):
        """writePyroNoise writes flowgrams in pyronoise format."""
  
        small_seq_path = get_tmp_filename(
            prefix='writePyroNoiseTest_', suffix='.dat')
        write_pyronoise_file(self.small_flowgram_collection.iterFlows(),
                           len(self.small_flowgram_collection),
                           filename=small_seq_path)
        
        actual = "".join((open(small_seq_path)).readlines())
        remove(small_seq_path)
        self.assertEqual(actual, self.file_content)
        
    def test_Pyronoise(self):
        """PyroNoise computes centroids."""

        #If the test fails, keep this in mind:        
        #Pyronoise uses EM, so is basically a random process.
        #However, the data set should be simple enough, that 
        #the results should be always the same.
        actual_centroids, actual_cluster_sizes =\
            pyroNoise(self.large_flowgram_collection.iterFlows(),
                      len(self.large_flowgram_collection))
        self.assertEqualItems(actual_centroids.values(), large_example_seqs)
        self.assertEqualItems(actual_cluster_sizes.values(),
                              [36, 17, 7, 1, 1, 4, 1, 1, 1])
  
    def test_Pyronoise_mpi(self):
        """PyroNoise works fine with mpi."""
        actual_centroids, actual_cluster_sizes =\
            pyroNoise(self.small_flowgram_collection.iterFlows(),
                      len(self.small_flowgram_collection), num_cpus=2)
        self.assertEqualItems(actual_centroids.values(), 
                         ['ATTAGATACCCCGGTAGTCCACGCCGTAAACGA',
                          'TTTTACGAGTACCGGTAAGTACCACCCGTAAACGA'])
        self.assertEqualItems(actual_cluster_sizes.values(), [19,1])
        
    def test_pyroNoise_otu_picker(self):
        """PyroNoise works as an OTU picker"""

        actual_centroids, actual_otu_map = pyroNoise_otu_picker(open(self.sff_path), num_cpus=1)
    
